async () => {
		// storeValue('customerOID', '0df5b01a');
		// storeValue('customerJID', 'IN');
		const keyPersonData = await SelectRelatedIndividual.run();

		for (let i = 0; i < keyPersonData.length; i++) {
			const kycData = await JSObject1.getIndKYCDocData(
				keyPersonData[i].OID,
				keyPersonData[i].CUSTOMER_KEY_PERSON_ENTITY_TYPE
			);

			if (kycData && kycData.length) {
				kycData.forEach((data) => {
					console.log(data);
					InsertIndKYCDetails.run({
						customerOID: appsmith.store.customerOID,
						keyPersonID: data.keyPId,
						keyPersonType: data.keyPType,
						docType: data.docTypeCode,
						fileName: data.FileName,
						link: data.url,
					});
				});
			}
		}
	}

